in life and archival footage for atmosphere, this film traces Harvey Milk's career from his 
40th birthday to his death. He leaves the closet and New York, opens a camera shop that becomes 
the salon for San Francisco's growing gay community, and organizes gays' purchasing power to 
build political alliances. He runs for office with lover Scott Smith as his campaign manager. 
